import React, { useState, useEffect } from "react";
import "./ReportsPage.css";

const ReportsPage = () => {
  const [reports, setReports] = useState([]);

  useEffect(() => {
    // Fetch data from Oracle SQL backend (replace with actual API endpoint)
    const fetchReports = async () => {
      try {
        const response = await fetch("http://your-backend-api/reports"); // Replace with actual endpoint
        const data = await response.json();
        setReports(data);
      } catch (error) {
        console.error("Error fetching reports:", error);
      }
    };

    fetchReports();
  }, []);

  return (
    <div className="reports-container">
      <h2>Reports</h2>

      <table className="reports-table">
        <thead>
          <tr>
            <th>Forklift ID</th>
            <th>Start Time</th>
            <th>Material Pick Time</th>
            <th>End Ride Time</th>
            <th>Gap (Pick & Drop)</th>
            <th>Gap (Pick & Start)</th>
            <th>Last Maintenance Date</th>
          </tr>
        </thead>

        <tbody>
          {reports.length > 0 ? (
            reports.map((report, index) => (
              <tr key={index}>
                <td>{report.forkliftId}</td>
                <td>{report.startTime}</td>
                <td>{report.materialPickTime}</td>
                <td>{report.endRideTime}</td>
                <td>{report.gapPickDrop} mins</td>
                <td>{report.gapPickStart} mins</td>
                <td>{report.lastMaintenanceDate}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="7">No reports available</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default ReportsPage;
